import CustomButton from "../CustomButton"
const options = [
  { value: 'google', label: 'Google' }
]

const NavBar = () => {

  const IconButton = (props: any) => {
    const { path } = props || {}
    return (<CustomButton className="text-[14px] font-medium !w-[48px] flex justify-center items-center">
      <img src={`images/${path}`} alt='logo' />
    </CustomButton>
    )
  }
  return (
    <nav className="p-5 bg-[#FFFFFF] text-white flex items-center justify-between flex-wrap px-6 fixed w-[81%] left-[101px] top-0 z-50">
      <div className="flex items-center gap-2">
        <p className="text-black_500 text-[16px] font-bold ">Review</p>
        <select className="border-2 border-[#4D4CAC] text-black_500 text-[16px] !min-w-[184.75px] h-[40px] rounded-[8px]">
          {
            (options || []).map((option, index) => {
              return (
                <option key={index} value={option.value}>{option.label}</option>
              )
            })
          }
        </select>
        <CustomButton className="bg-[#40E1FA1A] text-[#2CA01D] text-[12px] font-bold">Quickbookâ€™s Data</CustomButton>
      </div>
      <div className="flex items-center gap-1 flex-wrap">
        <IconButton path='search.svg' />
        <CustomButton className="text-[14px] font-medium">Export to Excel</CustomButton>
        <CustomButton className="text-[14px] font-medium ">Add Dcoument</CustomButton>
        <CustomButton className="text-[14px] font-medium ">Connect</CustomButton>
        <IconButton path='bell.svg' />
        <IconButton path='settings.svg' />
        <IconButton path='person.svg' />

      </div>
    </nav>
  )
}

export default NavBar
